import colorVariables from "../assets/colorVariables";


const navLinks = [
    {
        id: 1,
        name: "about",
        i: "fa-solid fa-user",
        color: $green,
        link:"/about"
    },
    {
        id: 2,
        name: "projects",
        i: "fa-solid fa-laptop-code",
        color: "rgba(237, 109, 49, 1.00)",
        link: "/projects"
    },
    {
        id: 3,
        name: "contact",
        i: "fa-solid fa-envelope",
        color: "rgba(171, 165, 21, 1.00)",
        link: "/contact"
    },
    {
        id: 4,
        name: "github",
        i: "fa-brands fa-github",
        color: "rgba(170, 92, 128, 1.00)",
        link: "/github"
    },
    {
        id: 5,
        name: "linkedin",
        i: "fa-brands fa-linkedin",
        color: "rgba(15, 111, 154, 1.00)",
        link: "/linkedin"
    },
];

export default navLinks;
